import React from 'react';
import { View, Image } from 'react-native';

const MapComponent = ({ latitude, longitude }) => {
  const mapUrl = `https://api.mapbox.com/styles/v1/mapbox/streets-v11/static/${longitude},${latitude},14,0,0/600x600?access_token=YOUR_MAPBOX_ACCESS_TOKEN`;

  return (
    <View style={{ flex: 1 }}>
      <Image source={{ uri: mapUrl }} style={{ flex: 1 }} />
    </View>
  );
};

export default MapComponent;
